import { Button, Card,Image } from "react-bootstrap";

const Product = () => {
  return (
    <>
      <Card className="m-2">
        <Image
          width="100%"
          height="100%"
          src="https://i.ibb.co/R70vBrQ/men.png"
          class="img-thumbnail"
        />
        <p class="lead">
          This is a title
        </p>
        <h6 class="lead">$ 400</h6>
        <Button type="submit">Add To Cart</Button>
      </Card>
    </>
  );
};

export default Product;
